//import logo from './web_logo.svg';
//import './App.css';
import React from 'react';
import Leftheader from './Leftheader';
import Topnav from './Topnav';
import Sidebarnav from './Sidebarnav';
import Combined from './components/Combined';
import Effluent from './components/Effluent';
import Solids from './components/Solids';
import Ammonia from './components/Ammonia';
import Bod from './components/Bod';
import './assets/css/style.css';
import './assets/css/custom.css';


//import './assets/js/jquery.min.js';
//import './assets/js/main.js';



function App() {
	const data = [
  {
    "name": "Page A",
    "uv": 4000,
    "pv": 2400,
    "amt": 2400
  },
  {
    "name": "Page B",
    "uv": 3000,
    "pv": 1398,
    "amt": 2210
  },
  {
    "name": "Page C",
    "uv": 2000,
    "pv": 9800,
    "amt": 2290
  },
  {
    "name": "Page D",
    "uv": 2780,
    "pv": 3908,
    "amt": 2000
  },
  {
    "name": "Page E",
    "uv": 1890,
    "pv": 4800,
    "amt": 2181
  },
  {
    "name": "Page F",
    "uv": 2390,
    "pv": 3800,
    "amt": 2500
  },
  {
    "name": "Page G",
    "uv": 3490,
    "pv": 4300,
    "amt": 2100
  }
]
  return (
  <>
  <div class="main-outer">
    <Leftheader />
	<div class="main-content-sec">
	<Topnav />
	 <div class="content-dis-main">
	<span class="left-menu-toggle"><i class="far fa-chevron-double-right"></i></span>
	<Sidebarnav />
	<div class="page-content-area scroll-bar">
	<Combined />
	<div class="grap-main-row d-flex flex-wrap">
	<Effluent />
	<Solids />
	<Ammonia />
	<Bod />
	</div>
	</div>
	</div>
	
	</div>
	
	</div>
	
	</>
  );
}
 
export default App;
